import dummyData from "./dummy";
import icons from "./icons";
import images from "./images";
import videos from "./videos";
import theme, { COLORS, SIZES, FONTS, darkTheme, lightTheme, selectedTheme, windowWidth, windowHeight } from "./theme";

export {
    
    dummyData,
    icons,
    images,
    theme,
    COLORS,
    SIZES,
    FONTS,
    darkTheme,
    lightTheme,
    selectedTheme,
    windowWidth,
    windowHeight,
    videos
};
